// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SelfAppReleaseRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SelfAppRelease) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSelfAppReleaseByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSelfAppReleaseUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSelfAppReleaseByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseByPackageNameChannelBuildNumPrefix, item.PackageName, item.Channel, item.BuildNum)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseUnscopedByPackageNameChannelBuildNumPrefix, item.PackageName, item.Channel, item.BuildNum)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseByPackageNameChannelGrayStrategyPrefix, item.PackageName, item.Channel, item.GrayStrategy)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseUnscopedByPackageNameChannelGrayStrategyPrefix, item.PackageName, item.Channel, item.GrayStrategy)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseByPackageNameChannelPrefix, item.PackageName, item.Channel)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseUnscopedByPackageNameChannelPrefix, item.PackageName, item.Channel)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseByPackageNamePrefix, item.PackageName)] = struct{}{}
			KeyMap[s.cache.Key(CacheSelfAppReleaseUnscopedByPackageNamePrefix, item.PackageName)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
